export default interface Client {
    get(url: URL | string, signal?: AbortSignal): Promise<Response>;
    post(url: URL | string, body: BodyInit, signal?: AbortSignal): Promise<Response>;
    patch(url: URL | string, body: BodyInit, signal?: AbortSignal): Promise<Response>;
    delete(url: URL | string, body?: BodyInit, signal?: AbortSignal): Promise<Response>;
    setHeader(name: string, value: string): void;
}
